import { css } from "styled-components";

export const AlignSelfFlexCenter = css`
  align-self: flex-center;
`;

export const ValignTextMiddle = css`
  display: flex;
  flex-direction: column;
  justify-content: center;
`;

export const HeeboNormalLicorice20px = css`
  color: var(--licorice);
  font-family: var(--font-family-heebo);
  font-size: var(--font-size-xxs);
  font-weight: 400;
  font-style: normal;
`;

export const RobotoBoldBlack241px = css`
  color: var(--black);
  font-family: var(--font-family-roboto);
  font-size: 24.1px;
  font-weight: 700;
  font-style: normal;
`;

export const RobotoslabBoldBlueGray23px = css`
  color: var(--telepossible-blue);
  font-family: var(--font-family-roboto_slab);
  font-size: var(--font-size-xs);
  font-weight: 700;
  font-style: normal;
`;

export const ZenkakugothicnewMediumJaguar25px = css`
  color: var(--jaguar);
  font-family: var(--font-family-zen_kaku_gothic_new);
  font-size: var(--font-size-m);
  font-weight: 500;
  font-style: normal;
`;

export const NotoserifBoldJaguar55px = css`
  color: var(--jaguar-2);
  font-family: var(--font-family-noto_serif);
  font-size: var(--font-size-l);
  font-weight: 700;
  font-style: normal;
`;

export const OswaldMediumWhite20px = css`
  color: var(--white);
